function MenuItem({image, name, description}) {
  return (
    <a className='menuItem' href='youtube'>
        <div style={{backgroundImage: `url(${image})`}}></div>
        <h1>{name}</h1>
        <p>{description}</p>
    </a>
  )
}

export default MenuItem
